// import "./IERC20.sol";

contract MintToken is ERC20, ERC20Burnable, Ownable {
    constructor(address initialOwner)
        ERC20("MuhminToken", "MIN")
        Ownable(initialOwner)
    {}

    function mint(address to, uint256 amount) public onlyOwner {
        _mint(to, amount);
    }

    // Token swap method
    function swapTokens(address tokenToSwap, address recipient, uint256 amount) public {
        IERC20 token = IERC20(tokenToSwap);
        require(token.allowance(msg.sender, address(this)) >= amount, "Token allowance too low");
        
        // Transfer tokens from the sender to the recipient
        require(token.transferFrom(msg.sender, recipient, amount), "Token transfer failed");
    }
}

